import Link from 'next/link';

export default function Index() {
  return (
    <div>

      <div class="homeHead">

        <p id="about">ABOUT</p>

        <div class="home-title">
          <h1>Code <br /> Blue </h1>
        </div>

        <div class="home-text">
          <Link href="/menu">
            <a>ENTER</a>
          </Link>
        </div>

	  	</div>

      <style jsx>{`

        * { padding: 0; margin: 0 auto; box-sizing: border-box; border: 1px solid black; }

        .homeHead {
          overflow: hidden;
          top: 0;
          right: 0;
          background: blue;
          display: block;
          width: 100vw;
          height: 100vh;
        }

        #about {
          float: right;
          padding: 25px;
          font-family: Montserrat;
          font-size: 100%;
        }

        .home-title { 
          float: left;
          text-align: left;
          padding-top: 50px;
          margin-left: 50vw;
          height: 80%;
          padding-bottom: 5vh;
        }

        .home-text { 
          float: left;
          text-align: left;
          margin-left: 50px;
          width: 80vw;
        } 

        h1 { 
          font-family: Raleway; 
          font-size: 800%;
        }

        a { 
          font-family: Montserrat; 
          font-size: 150%; 
          text-decoration: none;
        }      
      `}</style>

    </div>
  );
}
